package com.loyauty.web.struts.action.orders;

import com.loyauty.service.ServiceLocator;
import com.loyauty.service.core.dto.UserConnectionDTO;
import com.loyauty.service.user.UserService;
import com.loyauty.web.struts.action.LoyautyAction;
import java.io.File;
import java.io.FileInputStream;
import java.io.InputStream;
import java.util.List;

import lombok.Getter;
import lombok.Setter;

public class DownloadFile extends LoyautyAction{
	private static final long serialVersionUID = 1908253872378165108L;

	@Getter @Setter
	private InputStream fileInputStream;
	@Getter @Setter
	private String fileToImport="";
	private ServiceLocator serviceLocator;
	private UserService userService;
	@Getter @Setter
	private String userLogin;
	@Override
	public String execute() throws Exception {							
		serviceLocator = ServiceLocator.getInstance();
		try{
			//===========>Instantiate Services
			userService = serviceLocator.getUserService();
			//===========>download File
			UserConnectionDTO userConnDTO=userService.getUserConnectionByLogin(userLogin);
			if(userConnDTO==null){
				addActionError(getText("loyauty.error.common.userFilePoOrders"));
			}else{
				fileInputStream = new FileInputStream(new File( userConnDTO.getOrdersFolder()+fileToImport));	
			}
			return SUCCESS;
		}catch (Exception e) {
			// TODO: handle exception
			e.printStackTrace();
			return ERROR;
		}

	}

}


